import React from "react";
import styled from "styled-components";
import Hero from "../assets/image/landing.png";

export const LandingPage = () => {
  return (
    <Container>
      <img src={Hero} alt="" />
      <button>Enter the Website</button>
    </Container>
  );
};

const Container = styled.div`
  width: 1400px;
  min-height: 100vh;
  img{
    width:100%;
    height:50%;

  }
`;
